import ExpenseItem from "./ExpenseItem";

function ExpensesDisplayer(props) {

    const firstComp = props.date;
    const secondComp = props.title;
    const thirdComp = props.amount;

    return (
        <div className="expenses">
          <ExpenseItem
            title={firstComp[0].title}
            amount={secondComp[0].amount}
            date={thirdComp[0].date}
          />
        </div>
      );
}

export default ExpensesDisplayer;
